The various X-Men teams, after being spread out throughout the globe, finally come together to deal with a major threat on the island of Genosha. Events of this crossover would affect all three books for years as well as leading directly in the X-Men v1 01, which featured the return of Magneto as well as his new Acolytes. Every issue is digital thanks to Minutemen-Phantasm. Please seed, and enjoy - I have plenty more X-Men posts to come! :-)
